create or replace function public.f_md_get_layerlist() returns json
	language sql
as $$
select json_build_object(
               'subjects', json_agg(
                json_build_object(
                        'description', description,
                        'subjectorder', subjectorder,
                        'layers', layers
                    )
            )
           ) subjects
from public.md_subjects s
         left join (
    select c.subjectid,
           json_agg(
                   json_build_object(
                           'semanticid', c.semanticid,
                           'title', l.title,
                           'restaddress', restaddress
                       )
               ) layers
    from public.md_subjects_layers c
             join public.md_layers l
                  on c.semanticid = l.semanticid
             join public.md_subjects y on y.subjectid = c.subjectid
    group by c.subjectid
) a
                   on s.subjectid = a.subjectid;

$$;

alter function public.f_md_get_layerlist() owner to postgres;


